import React, {Component}  from 'react'
import {connect} from 'react-redux';
import {bindActionCreators} from 'redux';
import { Container, Row, Col} from 'reactstrap'
import Form from 'react-bootstrap/Form'
import Button from 'react-bootstrap/Button'
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom'
import Nav from 'react-bootstrap/Nav'
import NavDropdown from 'react-bootstrap/NavDropdown'
import {handleSelect} from '../actions/index';
class Home extends Component{

    constructor(props){
        super(props);                    
    }        

    render(){
        return(
            // <nav>
            //     <ul>
            //     <li>
            //         <Link to="/">Home</Link>
            //     </li>
            //     <li>
            //         <Link to="/login">Users</Link>
            //     </li>
            //     </ul>
            // </nav>


            <Nav variant="pills" activeKey="1" onSelect={handleSelect}>               
                <NavDropdown title="Menu" id="nav-dropdown">
                    <NavDropdown.Item eventKey="1">Dashboard</NavDropdown.Item>
                    <NavDropdown.Item eventKey="2">Incluir movimentação</NavDropdown.Item>
                    <NavDropdown.Item eventKey="3">Editar/ Excluir movimentação</NavDropdown.Item>
                    <NavDropdown.Item eventKey="4">Consultar movimentação</NavDropdown.Item>
                </NavDropdown>
            </Nav>

        )
      }    
}
function mapDispatchToProps(dispatch){
    return bindActionCreators({}, dispatch);
}
export default connect(null, mapDispatchToProps)(Home);
